export const initialState = {
	mainPosts: [{
		id: 1,
		User: {
			id: 1,
			nickname: '우종이',
		},
		content: '첫 번째 게시글 #해시태그 #익스프레스',
		Images: [{
			src: 'data:image/png;base64,',
		}, {
			src: 'data:image/png;base64,',
		}, {
			src: 'data:image/jpeg;base64,',
		}],
		Comment: [{
			User: {
				nickname: '데브종',
			},
			content: '우와 이게 게시글인가요?',
		}, {
			User: {
				nickname: '개발자',
			},
			content: '정말 형편없어요~',
		}]
	}],
	imagePaths: [],
	postAdded: false,
};

const reducer = (state = initialState, action) => {
	switch (action.type) {
		default:
			return state;
	}
};

export default reducer;
